import Layout from '../components/MyLayout';

const Index = props => (
    <Layout>
        <h3>PROFIL MAHASISWA STIKOM PGRI BANYUWANGI</h3>
        <h4>Nama : ERNAWATI<br/>
        NIM    : 1118101536<br/>
        Jurusan : S1 Teknik Informatika<br/>
        TTL    : Banyuwangi, 03 Januari 1989<br/>
        Alamat : Jl. Brawijaya RT. 001 RW. 001 Banyuwangi<br/>
        Pekerjaan : Mahasiswa/TAS SMALB Negeri Banyuwangi<br/>
        Hobi      : Olahraga, Menjahit, MUA<br/>
        </h4>
    </Layout>
);

export default Index;
